			and tmp_cat_id = pn_CategoriaId;
		elseif vn_TotRecs = 5 then
			if vn_Aleatorio < 0.5 then
        	        	set vn_PartidoTmp = 9;
			else
		                set vn_PartidoTmp = 24;
			end if;
			update cmt_tmp_draws
			set tmp_jug_id_local = vn_JugId,
			    tmp_clu_id_local = vn_CluId
			where tmp_partido = vn_PartidoTmp
			and tmp_cat_id = pn_CategoriaId;
		        if vn_Aleatorio < 0.5 then
		                set vn_PartidoTmp = 24;
			else
                		set vn_PartidoTmp = 9;
			end if;
		elseif vn_TotRecs = 7 then
		        if vn_Aleatorio < 0.5 then
                		set vn_PartidoTmp = 8;
			else
		                set vn_PartidoTmp = 25;
			end if;
			update cmt_tmp_draws
			set tmp_jug_id_local = vn_JugId,
			    tmp_clu_id_local = vn_CluId
			where tmp_partido = vn_PartidoTmp
			and tmp_cat_id = pn_CategoriaId;
		        if vn_Aleatorio < 0.5 then
                		set vn_PartidoTmp = 25;
			else
		                set vn_PartidoTmp = 8;
			end if;
		else
			if vn_TotRecs = 9 then
				update cmt_tmp_draws
				set tmp_jug_id_visita = 0
                where tmp_partido < 33
				and tmp_cat_id = pn_CategoriaId
                and tmp_jug_id_visita is null
				order by tmp_siembra, tmp_orden_byes limit vn_TotByes;
				
				select row_count() into vn_Count;
--				select vn_TotByes, vn_Count;
				
				set vn_TotByes = vn_TotByes - vn_Count;
--				select vn_TotByes;
				if vn_TotByes <= 0 then
				  set vn_TotByes = 0;
				end if;
--				select vn_TotByes;

				update cmt_tmp_draws
				set tmp_jug_id_local = 0
		        where tmp_partido < 33
				and tmp_cat_id = pn_CategoriaId
                and tmp_jug_id_local is null
				order by tmp_siembra, tmp_orden_byes limit vn_TotByes;

--				select row_count() into vn_Count;
--				select vn_TotByes, vn_Count;
				
			end if;
			if vn_Aleatorio < 0.5 then
				set vn_PartidoTmp = 1;
			else
				set vn_PartidoTmp = -1;
			end if;
			update cmt_tmp_draws
			set tmp_jug_id_local = vn_JugId,
		        tmp_clu_id_local = vn_CluId
            where tmp_partido > 0
			and   tmp_jug_id_local is null
			and   tmp_partido < 33
			and   tmp_cat_id  = pn_CategoriaId
			and   ( tmp_clu_id_visita <> vn_CluId or vn_CluId = 1)
			order by vn_PartidoTmp * tmp_partido desc limit 1;

			select row_count() into vn_Count;

			if vn_Count = 0 then
				update cmt_tmp_draws
				set tmp_jug_id_visita = vn_JugId,
			        tmp_clu_id_visita = vn_CluId
		        where tmp_partido > 0
				and   tmp_jug_id_visita is null
				and   tmp_partido < 33
				and   tmp_cat_id = pn_CategoriaId
				and   ( tmp_clu_id_local <> vn_CluId or vn_CluId = 1)
				order by vn_PartidoTmp * tmp_partido desc limit 1;

				update cmt_tmp_draws
				set tmp_ = vn_Aleatorio
				where tmp_jug_id_visita = vn_JugId
				and tmp_cat_id          = pn_CategoriaId
				and tmp_partido        > 0;

			else
				update cmt_tmp_draws
				set tmp_ = vn_Aleatorio
				where tmp_jug_id_local = vn_JugId
				and tmp_cat_id         = pn_CategoriaId
				and tmp_partido        > 0;
			end if;	
		end if;
        
	END LOOP get_inscritos;
	CLOSE cur_inscritos;    

	update cmt_tmp_draws
	set tmp_jug_id_local = 4,
	    tmp_clu_id_local = 1
	where tmp_partido > 0
	and tmp_cat_id = pn_CategoriaId
	and (tmp_jug_id_local is null or tmp_jug_id_local = 0);

	update cmt_tmp_draws
	set tmp_jug_id_visita = 4,
	    tmp_clu_id_visita = 1
	where tmp_partido > 0
	and tmp_cat_id = pn_CategoriaId
	and (tmp_jug_id_visita is null or tmp_jug_id_visita = 0);

END$$

