						elseif vn_TotRecs = 93 then
							set vn_PartidoTmpPar = 158;
							set vn_PartidoTmpNon = 164;
						elseif vn_TotRecs = 95 then
							set vn_PartidoTmpPar = 190;
							set vn_PartidoTmpNon = 132;
						elseif vn_TotRecs = 97 then
							set vn_PartidoTmpPar = 131;
							set vn_PartidoTmpNon = 189;
						elseif vn_TotRecs = 99 then
							set vn_PartidoTmpPar = 163;
							set vn_PartidoTmpNon = 157;
						elseif vn_TotRecs = 101 then
							set vn_PartidoTmpPar = 173;
							set vn_PartidoTmpNon = 147;
						elseif vn_TotRecs = 103 then
							set vn_PartidoTmpPar = 179;
							set vn_PartidoTmpNon = 141;
						elseif vn_TotRecs = 105 then
							set vn_PartidoTmpPar = 171;
							set vn_PartidoTmpNon = 155;
						elseif vn_TotRecs = 107 then
							set vn_PartidoTmpPar = 165;
							set vn_PartidoTmpNon = 149;
						elseif vn_TotRecs = 109 then
							set vn_PartidoTmpPar = 187;
							set vn_PartidoTmpNon = 133;
						elseif vn_TotRecs = 111 then
							set vn_PartidoTmpPar = 181;
							set vn_PartidoTmpNon = 139;
						elseif vn_TotRecs = 113 then
							set vn_PartidoTmpPar = 136;
							set vn_PartidoTmpNon = 185;
						elseif vn_TotRecs = 115 then
							set vn_PartidoTmpPar = 152;
							set vn_PartidoTmpNon = 168;
						elseif vn_TotRecs = 117 then
							set vn_PartidoTmpPar = 153;
							set vn_PartidoTmpNon = 169;
						elseif vn_TotRecs = 119 then
							set vn_PartidoTmpPar = 144;
							set vn_PartidoTmpNon = 184;
						elseif vn_TotRecs = 121 then
							set vn_PartidoTmpPar = 137;
							set vn_PartidoTmpNon = 177;
						elseif vn_TotRecs = 123 then
							set vn_PartidoTmpPar = 145;
							set vn_PartidoTmpNon = 176;
						elseif vn_TotRecs = 125 then
							set vn_PartidoTmpPar = 160;
							set vn_PartidoTmpNon = 161;
						elseif vn_TotRecs = 127 then
							set vn_PartidoTmpPar = 192;
							set vn_PartidoTmpNon = 129;
						end if;
					end if;
					-- Nones
					set vn_PartidoTmp = vn_PartidoTmpNon;
				else
					-- Pares
					set vn_PartidoTmp = vn_PartidoTmpPar;
				end if;					
				-- Actualiza visitantes
				update cmt_tmp_draws
				set tmp_jug_id_visita = vn_JugId,
					tmp_clu_id_visita = vn_CluId
				where tmp_partido = vn_PartidoTmp
				and tmp_cat_id = pn_CategoriaId;				
			end if;
			
		END LOOP get_inscritos;
		CLOSE cur_inscritos; 
		
	else
		-- Se debe generar Round Robin para esta combinación torneo-categoría
		set vn_Count = 0;
	end if;

	update cmt_tmp_draws
	set tmp_jug_id_local = 4,
	    tmp_clu_id_local = 1
	where tmp_partido > 0
	and tmp_cat_id = pn_CategoriaId
	and (tmp_jug_id_local is null or tmp_jug_id_local = 0);

	update cmt_tmp_draws
	set tmp_jug_id_visita = 4,
	    tmp_clu_id_visita = 1
	where tmp_partido > 0
	and tmp_cat_id = pn_CategoriaId
	and (tmp_jug_id_visita is null or tmp_jug_id_visita = 0);

END$$

