--
-- Structure for view `CMT_VIE_ADDRESS_BOOK`
--
DROP TABLE IF EXISTS `CMT_VIE_ADDRESS_BOOK`;

CREATE ALGORITHM=UNDEFINED DEFINER=`cmtcom`@`localhost` SQL SECURITY DEFINER VIEW `CMT_VIE_ADDRESS_BOOK`  AS  select 'First Name' AS `First Name`,'Email' AS `Email`,'Mobile Phone' AS `Mobile Phone`,'Birthday' AS `Birthday`,'Notes' AS `Notes` union select `cmt_jug_jugadores`.`JUG_NOMBRE` AS `jug_nombre`,`cmt_jug_jugadores`.`JUG_EMAIL` AS `jug_email`,`cmt_jug_jugadores`.`JUG_TELEFONO` AS `jug_telefono`,coalesce(`cmt_jug_jugadores`.`JUG_FCH_NACIMIENTO`,'1900-01-01') AS `jug_fch_nacimiento`,concat(`cmt_clu_clubes`.`CLU_NOMBRE`,' categoría ',`cmt_cat_categorias`.`CAT_NOMBRE`) AS `concat(clu_nombre," categoría ",cat_nombre)` from ((`cmt_jug_jugadores` join `cmt_clu_clubes`) join `cmt_cat_categorias`) where ((1 = 1) and (`cmt_jug_jugadores`.`JUG_ACTIVO` = 'S') and (`cmt_jug_jugadores`.`JUG_CLU_ID` = `cmt_clu_clubes`.`CLU_ID`) and (`cmt_jug_jugadores`.`JUG_CAT_ID` = `cmt_cat_categorias`.`CAT_ID`) and exists(select 1 from `cmt_ins_inscripciones` where (`cmt_ins_inscripciones`.`INS_JUG_ID` = `cmt_jug_jugadores`.`JUG_ID`))) ;

