--
-- Structure for view `CMT_VIE_ANALISIS_INSCRIPCIONES`
--
DROP TABLE IF EXISTS `CMT_VIE_ANALISIS_INSCRIPCIONES`;

CREATE ALGORITHM=UNDEFINED DEFINER=`cmtcom`@`localhost` SQL SECURITY DEFINER VIEW `CMT_VIE_ANALISIS_INSCRIPCIONES`  AS  select `cmt_tor_torneos`.`TOR_ID` AS `tor_id`,`cmt_tor_torneos`.`TOR_NOMBRE` AS `tor_nombre`,`cmt_tor_torneos`.`TOR_FCH_INICIO` AS `tor_fch_inicio`,`cmt_clu_clubes`.`CLU_ID` AS `clu_id`,`cmt_clu_clubes`.`CLU_NOMBRE` AS `clu_nombre`,`cmt_cat_categorias`.`CAT_ID` AS `cat_id`,`cmt_cat_categorias`.`CAT_NOMBRE` AS `cat_nombre`,`cmt_jug_jugadores`.`JUG_ID` AS `jug_id`,`cmt_jug_jugadores`.`JUG_NOMBRE` AS `jug_nombre`,`cmt_ins_inscripciones`.`INS_FCH_INSCRIPCION` AS `ins_fch_inscripcion`,(to_days(`cmt_tor_torneos`.`TOR_FCH_INICIO`) - to_days(`cmt_ins_inscripciones`.`INS_FCH_INSCRIPCION`)) AS `dias_inscripcion_antes_del_cierre`,dayname(`cmt_ins_inscripciones`.`INS_FCH_INSCRIPCION`) AS `dia_semana_inscripcion`,dayofmonth(`cmt_ins_inscripciones`.`INS_FCH_INSCRIPCION`) AS `dia_mes_inscripcion`,hour(`cmt_ins_inscripciones`.`INS_FCH_INSCRIPCION`) AS `hora_inscripcion`,minute(`cmt_ins_inscripciones`.`INS_FCH_INSCRIPCION`) AS `minuto_inscripcion`,`clj`.`CLU_NOMBRE` AS `club_jugador` from (((((`cmt_ins_inscripciones` join `cmt_jug_jugadores`) join `cmt_clu_clubes`) join `cmt_tor_torneos`) join `cmt_cat_categorias`) join `cmt_clu_clubes` `clj`) where ((1 = 1) and (`cmt_ins_inscripciones`.`INS_FCH_INSCRIPCION` between '2017-01-01' and '2017-12-31') and (`cmt_ins_inscripciones`.`INS_INSCRITO` = 'S') and (`cmt_ins_inscripciones`.`INS_JUG_ID` = `cmt_jug_jugadores`.`JUG_ID`) and (`cmt_ins_inscripciones`.`INS_TOR_ID` = `cmt_tor_torneos`.`TOR_ID`) and (`cmt_ins_inscripciones`.`INS_CAT_ID` = `cmt_cat_categorias`.`CAT_ID`) and (`cmt_tor_torneos`.`TOR_CLU_ID` = `cmt_clu_clubes`.`CLU_ID`) and (`cmt_jug_jugadores`.`JUG_CLU_ID` = `clj`.`CLU_ID`)) ;

